#include <iostream>
#include <string>

using namespace std;

int strStr(string haystack, string needle) {
        bool match = false; int pos = 0;
        for(int i=0;i<haystack.length();i++){
            if(haystack[i]==needle[0]){
                int j=0;
                for(j=0;j<needle.length() && j+i<haystack.length();j++){
                    if(haystack[i+j]!=needle[j]) break;
                }
                if(j==needle.length()){
                    pos = i;
                    match=true; break;
                }
            }
        }
        if(match) return pos;
        else return -1;
}

int main(){
	cout << strStr("", "") << endl;


	return 0;
}